import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
  content: {
    flex: 1,
    width: "100%",
    flexDirection: "row",
    alignItems: "center",
    justifyContent: "center",
  },
  container: {
    flex: 1,
    height: "100%",
    alignItems: "flex-start",
    paddingHorizontal: 20,
    backgroundColor: "rgba(33, 33, 33, 1)",
  },
});

export default styles;
